import Card from "../Card/Card";
import "./Estilos/Cards.css"

function Cards({personajes}){
    return(
        <div className="Cards">
            {personajes.map(({id,nombre,estado,especie,origen,imagen})=>{
                return <Card 
                id = {id}
                key = {id}
                nombre={nombre} 
                estado={estado} 
                especie={especie} 
                origen={origen} 
                imagen={imagen}/>
            })}
        </div>
    )
}


export default Cards;
